import React from 'react';

function CreateQuestion () {
  return (
		<>
		<select>
			<option
			value="grapefruit"
			>
				Grapefruit
			</option>
			<option
			value="lime"
			>
				Lime
			</option>
		</select>
		</>
  );
}

export default CreateQuestion;
